import React from "react";
import "../css/style.css";
import "../img/*";

const Gallery = () => {
  return (
    <>
      <section>
        <div className="container">
          <div className="gallery">
            <img src="../img/s1200.jpg" width="600" height="400"></img>
            <div className="desc">Add photos</div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Gallery;
